  }
  window.addEventListener('scro')

  return (
    <>
      {['sm'].map((expand) => (
        <Navbar key={expand} expand={expand} className="navbar active mb-3 text-primary" style={{position:"fixed",width:"100%",zIndex:"1"}}>
          <Container fluid>
            <Navbar.Brand style={{color:"yellow"}} className="text-primary" href="#">Fuhad Sanin</Navbar.Brand>
            <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />
            <Navbar.Offcanvas
              id={`offcanvasNavbar-expand-${expand}`}
              aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
              placement="end"
            >
              <Offcanvas.Header closeButton >
                <Offcanvas.Title className='text-primary' id={`offcanvasNavbarLabel-expand-${expand}`}>
                  Fuhad Sanin
                </Offcanvas.Title>
              </Offcanvas.Header>
              <Offcanvas.Body className='responsive'>
                <Nav>
                  <Nav.Link href="#banner">Home</Nav.Link>
                  <Nav.Link href="#about">About</Nav.Link>
                  <Nav.Link href="#portfolio">Portfolio</Nav.Link>
                  <Nav.Link href="#contact">Contact</Nav.Link>


                </Nav>
                <button className='btn'>Resume</button>
              </Offcanvas.Body>
            </Navbar.Offcanvas>
          </Container>
        </Navbar>
      ))}
    </>
  );
}

export default Navbar_Design;
